import {
    SITE_LOADER
} from '../constants/constants';


/* const allOptions = localStorage.getItem('alloptions')
  ? JSON.parse(localStorage.getItem('alloptions'))
  : {} */

const initialState = {
    site_loader: false,
    bulk_form: {},
    bulk_result: {}
};

export const settingReducer = (state = initialState, action) => {
    switch (action.type) {
        case SITE_LOADER: {
            return {...state }
        }
        case SITE_LOADER: {
            return {...state }
        }
        default:
            return state;
    }
}
